def gaussxw(N,a=-1.0,b=1.0):

    # If N<=200 use look-up tables, else use Newton's method
    if N<=200:

        x,w = array(xlist[N],float),array(wlist[N],float)

    else:

        # Initial approximation to roots of the Legendre polynomial
        a = longdouble(linspace(3,4*N-1,N)/(4*N+2))
        x = cos(pi*a+1/(8*N*N*tan(a)))

        # Find roots using Newton's method
        epsilon = 1e-18
        delta = 1.0
        while delta>epsilon:
            p0 = ones(N,longdouble)
            p1 = copy(x)
            for k in range(1,N):
                p0,p1 = p1,((2*k+1)*x*p1-k*p0)/(k+1)
            dp = (N+1)*(p0-x*p1)/(1-x*x)
            dx = p1/dp
            x -= dx
            delta = max(abs(dx))

        # Calculate the weights
        w = 2*(1-x*x)/(N*N*p0*p0)

    return 0.5*(b-a)*x+0.5*(b+a),0.5*(b-a)*w
